    public function cats()
    {
        foreach ($this->gen(Category::inRandomOrder()->get()) as $i => $cat) {
            // if ($i > 0) continue;
            echo "<br>{$i}================================================<br>";
            echo "HERO STARTED.<br>";
            $hero = $this->scrape($this->images[round(rand(0, 960))], "categories/{$cat->slug}", 'hero');
            if (!$hero) continue;
        }
    }

    public function items()
    {
        foreach ($this->gen(Item::inRandomOrder()->get()) as $i => $item) {
            echo "<br>{$i}================================================<br>";

            $itemDir = "items/{$item->slug}";

            try {
                echo "HERO STARTED.<br>";
                $hero    = $this->scrape($this->images[round(rand(0, 960))], $itemDir, 'hero');

                foreach ($item->features as $j => $feature) {
                    echo "-------------------------------<br>";
                    echo "　{$i}-{$j} FEATURE STARTED.<br>";
                    $featureRes  = $this->scrape($this->images[round(rand(0, 960))], $itemDir, 'feature_' . ($j + 1));

                    if (!$featureRes) {
                        continue 1;
                    }
                }
            } catch (\Exception $e) {
                if (file_exists($itemDir)) {
                    rmdir($itemDir);
                    echo "{$itemDir} DELETED.<br>'";
                }
                echo "{$i} SKIPPED.<br>";
                continue;
            }
        }
    }

    public function icons()
    {
        foreach ($this->gen(Icon::inRandomOrder()->get()) as $i => $icon) {
            echo "<br>{$i}================================================<br>";

            $iconDir = "icons";

            try {
                echo "ICON STARTED.<br>";
                $icon    = $this->scrape($this->images[round(rand(1, 100))], $iconDir, $icon->slug);
            } catch (\Exception $e) {
                if (file_exists($iconDir)) {
                    rmdir($iconDir);
                    echo "{$iconDir} DELETED.<br>'";
                }
                echo "{$i} SKIPPED.<br>";
                continue;
            }
        }
    }

    public function scrape($url, $dir, $filename)
    {
        echo "{$dir} STARTED.<br>";

        $img_dir = public_path() . "/images/{$dir}";
        $file    = "{$img_dir}/{$filename}.jpg";

        if (file_exists($file)) {
            echo "{$file} ALREADY EXISTS.<br>";
            return false;
        }

        if ($img_data = @file_get_contents($url)) {
            if (!is_dir($img_dir)) {
                echo "{$img_dir} NOT EXISTS<br>";
                mkdir($img_dir, 0777, true);
                echo "{$img_dir} CREATED<br>";
            }

            file_put_contents($file, $img_data);
            echo "{$file} CREATION SUCCESS.<br>";
            return true;
        } else {
            throw new \Exception("{$url} COULD NOT GET.", 1);
        }
        $http_response_header = [];
    }

    public function makeImageUrl()
    {
        $url = "https://api.unsplash.com/photos/random?count=100&orientation=landscape&client_id=" . config('app.unsplash_access_key');
        return json_decode(file_get_contents($url), true);
    }

    public function gen($models)
    {
        foreach ($models as $model) {
            yield $model;
        }
    }

    public function min($path, $size = 1920)
    {
        $image = \Image::make($path);
        // EXIFのOrientationによって回転させる
        $image->orientate();
        // リサイズする
        $image->resize(
            $size,
            null,
            function ($constraint) {
                // 縦横比を保持したままにする
                $constraint->aspectRatio();
                // 小さい画像は大きくしない
                $constraint->upsize();
            }
        );
        // 保存する
        $image->save($path);
    }

    public function resizeCats()
    {
        foreach ($this->gen(Category::inRandomOrder()->get()) as $i => $category) {
            $filePath = public_path("images/categories/{$category->slug}/hero.jpg");
            if (file_exists($filePath)) {
                $this->min($filePath, 1920);
            }
        }
    }
    public function resizeIcons()
    {
        foreach ($this->gen(Icon::inRandomOrder()->get()) as $i => $icon) {
            $filePath = public_path("images/icons/{$icon->slug}.jpg");
            if (file_exists($filePath)) {
                $this->min($filePath, 80);
            }
        }
    }

    public function resizeItems()
    {
        foreach ($this->gen(Item::inRandomOrder()->get()) as  $item) {
            $filePath = public_path("images/items/{$item->slug}/hero.jpg");
            try {
                if (file_exists($filePath)) {
                    $this->min($filePath, 1920);
                    foreach ($item->features as $i => $feature) {
                        $featurePath = public_path("images/items/{$item->slug}/feature_" . $i + 1 . ".jpg");
                        $this->min($featurePath, 750);
                    }
                }
            } catch (\Exception $th) {
                echo "{$filePath} SKIPPED.";
                continue;
            }
        }
    }
}
